import React, { Component } from "react";
const Filter = ({ launch_year }) => {
  return (
    <div className="border bg-light p-2 ">
      <h2>Filters</h2>
      <div className="row">
        {launch_year.map((year) => (
          <div className="col">
            <button className="btn btn-primary p-1">{year}</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Filter;
